import React from 'react';

const ImageList = (props)=>{
    const Images = props.images.map((image)=>{
        return(
            <div>
                <img key={image.id} src={image.urls.regular} alt={image.description}/>
            </div>
        );
    });
    <div>
    {Images}
    </div>
}

export default ImageList;
